import React from "react";

const AstronomyCard = ({ cityName, stateName, sunrise, sunset, moonrise, moonset, moon_phase, moon_illumination}) => {
    return (
        <div>
            <h2>{cityName}{stateName}</h2>
            <p>Sunrise:{sunrise} Sunset:{sunset} Moonrise:{moonrise} Moonset:{moonset} Moon Phase:{moon_phase} Moon Illumination:{moon_illumination}</p>
        </div>
    )
};

export default AstronomyCard;
